import React from 'react';
import { Typography, Container } from '@mui/material';

function Payments() {
  return (
    <Container>
      <Typography variant="h4" sx={{ mt: 4, mb: 2 }} color="primary">
        Payments
      </Typography>
      <Typography>
        View and track payments here.
      </Typography>
    </Container>
  );
}

export default Payments;
